comment.body:
![high](https://www.gstatic.com/codereviewagent/high-priority.svg)

The custom `delay` function has a potential memory leak. The `abort` event listener is not removed if the delay promise resolves successfully. This can be an issue if the same `AbortSignal` is used for multiple `delay` calls.

Additionally, it's more idiomatic to reject with a `DOMException` with the name `AbortError` when an operation is aborted via an `AbortSignal`. This improves interoperability with other parts of the Web Platform APIs.

I suggest refactoring to remove the listener on successful completion and to use `DOMException`.

```typescript
async function delay(ms: number, options?: { signal?: AbortSignal }): Promise<void> {
	return new Promise<void>((resolve, reject) => {
		const { signal } = options ?? {};

		if (signal?.aborted) {
			reject(new DOMException('This operation was aborted', 'AbortError'));
			return;
		}

		let timeoutId: ReturnType<typeof setTimeout>;
		const abortListener = () => {
			clearTimeout(timeoutId);
			reject(new DOMException('This operation was aborted', 'AbortError'));
		};

		signal?.addEventListener('abort', abortListener);

		timeoutId = setTimeout(() => {
			signal?.removeEventListener('abort', abortListener);
			resolve();
		}, ms);
	});
}
```

